import {Image} from 'react-native';
import React from "react"; // Importação da biblioteca "React"
import styled from "styled-components/native";


const Header = styled.View`
flex-direction:row;
background-color: #DDD;
height: 300px;
flex-wrap: wrap;
justify-content: center;
`;

const Quadrado = styled.View`

background-color: ${props => props.cor};
width:350px;
height:300px;
justify-content:center;
align-items:row;
`;

const QuadradoG = styled.View`

background-color: ${props => props.cor};
width:900px;
height:300px;
justify-content:center;
align-items:row;
`;
const Pagina = styled.View`
  flex:1;

`;

function App() {
  return ( 

    <Pagina>
      <Header>

      <Quadrado  cor="white">

        <Image source={require('./src/imagens/01-27.png')}
           style={{width: 350, height: 300, backgroundColor:'#AAA'}}
           resizeMode='stretch' />

      </Quadrado>

      <Quadrado  cor="white">

        <Image source={require('./src/imagens/03-19.png')}
           style={{width: 350, height: 300, backgroundColor:'#AAA'}}
           resizeMode='stretch' />

      </Quadrado>

      <Quadrado  cor="white">

        <Image source={require('./src/imagens/02-21.png')}
        style={{width: 350, height: 300, backgroundColor:'#AAA'}}
        resizeMode='stretch' />

      </Quadrado>

      <Quadrado  cor="white">

        <Image source={require('./src/imagens/006.png')}
        style={{width: 350, height: 300, backgroundColor:'#AAA'}}
        resizeMode='stretch' />

        </Quadrado>

        <Quadrado  cor="white">

        <Image source={require('./src/imagens/0010.png')}
        style={{width: 350, height: 300, backgroundColor:'#AAA'}}
        resizeMode='stretch' />

        </Quadrado>

        <Quadrado  cor="white">

       <Image source={require('./src/imagens/04-21.png')}
       style={{width: 350, height: 300, backgroundColor:'#AAA'}}
       resizeMode='stretch' />

       </Quadrado>

      <QuadradoG cor="blue">

        <Image source={{uri:'https://www.pinpng.com/pngs/m/130-1302714_carros-png-mi-carro-sv-transparent-png.png'}}
           style={{width: 1000, height: 300, backgroundColor:'#AAA'}}
           resizeMode='stretch' />

      </QuadradoG>



      </Header>
    </Pagina>
  );
}

export default App;
